import React from "react";
import Input from "./common/input";
import Form from "./common/form";

class SearchInput extends Form {
  state = {
    data: { search: "" },
  };
  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
          {this.renderInput("search", "Search")}
        </form>
      </div>
    );
  }
}

export default SearchInput;
